          "nb" : "ethvert dokument som gir uttrykk for en panterett, stiftet ved avtale"
        },
        "remark" : {
          "nb" : "Pantedokumentet kan være et gjeldsbrev som i så fall er undertegnet av den som har lånt kapitalen, skyldneren, og er en sikkerhet for at den som har lånt ut kapitalen, panthaveren, skal få tilbake kapitalen. I Løsøreregisteret tinglyses det pantedokumenter med pant i driftstilbehør, jernbanemateriell, varelager, fiskeredskaper, motorvogn og anleggsmaskiner og redskaper, besetning, avling mv. i landbruksnæring."
