        },
        "remark" : {
          "nb" : "Botid for boenhet er tidsrommet fra boligen har vært den fysiske personens faste bopel (hjem). I skattemessig sammenheng regner en som hovedregel ikke med eventuelt tidsrom personen brukte boenheten før hun/han selv ble eier. Dersom personen i korte tidsrom oppholder seg borte fra boenheten på grunn av arbeid eller annen årsak, avbryter ikke dette botiden. Personen opparbeider normalt bare botid i en boenhet av gangen, men hun/han kan også opparbeide botid i sekundærbolig (pendlerbolig) nær arbeidssted dersom personen bruker denne sekundærboligen i stor utstrekning. Skatteloven § 9-3 andre ledd bokstav b andre punktum beskriver at personen skal godskrives botid i boenheten selv om hun/han har vært forhindret fra å bruke den."
        },
