          "nb" : "Skatteplikt til Norge for inntekt ved arbeid om bord på skip m.v. etter følgende regler: \n- ikke skattemessig bosatt i riket utenfor Norden, som utfører arbeid ombord på skip registrert i Norsk Ordinært Skipsregister (NOR) såfremt vedkommende er ansatt i tjeneste\n  - hos rederiet eller\n  - hos norsk arbeidsgiver som driver virksomhet om bord   \n- ikke skattemessig bosatt i riket utenfor Norden, som utfører arbeid ombord på skip registrert i Norsk Internasjonatl Skipsregister (NIS) er ikke skattepliktig for sin hyreinntekt\n  - Utfører skipet oppdrag på den norske kontinentalsokkelen, er hyreinntekten likevel skattepliktig etter petroleumsskatteloven\n- ikke skattemessig bosatt i riket men i Norden, når\n  - ansatt i tjeneste i rederiet ombord på norsk skip   registrert i NOR eller NIS\n  - ansatt ombord på skip registrert i NOR eller NIS i tjeneste hos norsk eller utenlandsk arbeidsgiver som driver virksomhet ombord\n  - ansatt i tjeneste på utenlandsregistrert fartøy\n    - som eies eller drives av norsk rederi eller\n    - hos norsk rederi eller hos norsk arbeidsgiver som driver virksomhet ombord på slikt fartøy"
