      "definition" : {
        "text" : {
          "nb" : "udekket underskudd oppstått ved skattleggingen i et tidligere år kan fremføres mot positiv alminnelig inntekt i senere inntektsår hos samme skattyter og/eller ektefelle. Hjemmelen er sktl § 14-6 første ledd som sier: \"Det gis fradrag for underskudd som omfattes av § 6-3 første ledd, som skattyteren har hatt i et forutgående år. Underskudd i et tidligere år skal være fratrukket i sin helhet før det gis fradrag for underskudd i et senere år.\" Sktl § 6-3 første ledd om underskudd sier: \"Når fradragsberettigede kostnader overstiger inntekter fra samme inntektskilde, gis det fradrag for underskuddet i inntekt fra andre inntektskilder.\" Underskudd kan fremføres i den utstrekning det ikke er kommet til fradrag i ektefelles eller barns inntekt i underskuddsåret, jf. sambeskatningsreglene i lovens kap. 2.  Bestemmelsen gir adgang til fremføring av det underskudd som fremkommer etter samordning av inntekter og fradrag fra skattyterens ulike inntektskilder i og utenfor virksomhet. Det er ingen begrensninger i hvilke inntektskilder underskuddet skriver seg fra. Foreldrefradrag, særfradrag etter sktl. § 6-80, etter overgangsregelen til tidligere § 6-81, etter § 6-82, etter overgangsregelen til tidligere § 6-83 og konsernbidrag etter sktl. § 10-2 første ledd kan ikke bringe alminnelig inntekt under null eller øke et underskudd til fremføring."
        },
