          "nb" : "inntektsfradrag som en personlig skattepliktig fastsetter sjablongmessig på grunnlag av arbeidsinntekt, pensjonsinntekt mv. som er mottatt i skattleggingsperioden"
        },
        "remark" : {
          "nb" : "En beregner minstefradrag av: arbeidsinntekt; pensjon og andre periodiske ytelser mv.; godtgjørelse som medlem av styre, representantskap, utvalg, råd og lignende; godtgjørelse for pass og stell i den skattepliktiges hjem av barn som ikke er fylt 12 år før utgangen av inntektsåret eller har særlig behov for omsorg og pleie. Den skattepliktige velger mellom minstefradrag og inntektsfradrag for de faktiske stillingskostnadene sine. Minstefradrag i egen inntekt avkorter likevel ikke retten til inntektsfradrag for fagforeningskontingent og merkostnader til opphold utenfor hjemmet."
