      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "fast forretningssted der et foretaks virksomhet helt eller delvis blir utøvet"
        },
        "remark" : {
          "nb" : "Fast driftssted er et vilkår for beskatning i Norge av virksomhetsinntekter når selskap eller næringsdrivende er hjemmehørende i et skatteavtaleland, at inntekten skriver seg fra forretningsvirksomhet som drives gjennom et fast driftssted i Norge. Et bygnings-, anleggs-, installasjons- eller monteringsprosjekt, eller virksomhet som består av planlegging, overvåking, rådgivning eller annen hjelpende personalinnsats i forbindelse med slikt prosjekt, utgjør også et fast driftssted, men bare i de tilfeller prosjektet eller virksomheten varer mer enn 12 måneder på samme sted. Fast driftssted foreligger også om en person i et annet land opptrer på vegne av et foretak, og han har en fullmakt som regelmessig anvendes, til å inngå avtaler som binder foretaket, s.k. avhengig agent."
        },
        "sources" : [ ]
      },
      "subject" : {
